import React from 'react';

const Footer = ({comments, shares, likes, emailLink}) => {
	return (
		<div>
			<div className='flex flex-row items-center justify-around'>
				<div className='w-25 items-center'><img alt='' src={require('./like.svg')} className='mw1'/>  {likes}</div>
				<div className='w-25'><img alt='' src={require('./comment.svg')} className='mw1'/>  {comments}</div>
				<div className='w-25'><img alt='' src={require('./share.svg')} className='mw1'/>  {shares}</div>
				<div className='w-25'><img alt='' src={require('./envelope.svg')} className='mw1'/></div>
			</div>
		</div>
		)
}

export default Footer;
